import React, { useState, useEffect } from "react";
import { SafeAreaView, StyleSheet, Text, View } from 'react-native';
import { TextInput, Button, Snackbar, Card } from "react-native-paper";
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import { loginstyle } from "./loginStyle";
import { Colors } from "react-native/Libraries/NewAppScreen";



export default function Login() {
  
  const navigation = useNavigation();

  const irToHome= () => {
      navigation.navigate('Entrar');
  }

  const irToRegister= () => {
    navigation.navigate('Register');
}
  
  
  
  
  return (
    <SafeAreaView style={loginstyle.content}>
      <View style={loginstyle.view}>
        <Card>
          <Card.Title title="InqHome"></Card.Title>
          <Card.Content>
            <TextInput label="Email" keyboardType="email-address" style={loginstyle.cardButton}></TextInput>
            <TextInput label="Senha" secureTextEntry={true} style={loginstyle.cardButton}></TextInput>
            <Button uppercase={false} style={loginstyle.cardButton}>Recuperar senha</Button>
            <Button mode="contained" style={loginstyle.cardButton} onPress={irToHome}>Login</Button>
            <Button style={loginstyle.cardButton} onPress={irToRegister}>Registrar</Button>
          </Card.Content>
        </Card>
      </View>
    </SafeAreaView>
  );
}
